What No One Knows (2008) Ded Som Ingen Ved


In this political thriller, a young woman is found drowned on a winter night by the sea. The dead woman's brother, Thomas, discovers that her death is connected to their father, now deceased, and his work in military intelligence. As Thomas digs deeper into the case his family is brought into sudden danger



Kwakkelende artiest Thomas Deleuran probeert met zijn reizende poppenkast het hoofd boven water te houden. Zijn vrouw wil van hem scheiden en hun dochter is niet onder de indruk van haar vaders optreden voor de plaatselijke jeugd. Zijn leven verandert radicaal met de dood van zijn zus Charlotte, die onthullende informatie over hun vader had. Ze heeft de informatie nooit aan hem kunnen vertellen, want ze werd verdronken teruggevonden op de plaats van afspraak. Thomas is vastbesloten de waarheid over zijn familie te achterhalen, maar heeft geen idee van het doodenge en gevaarlijke web waarin hij vast komt te zitten. De cameraÃ¢â‚¬â„¢s zoemen overal, zijn stappen worden nagegaan en niemand is meer veilig, ook zijn dochter nietÃ¢â‚¬Â¦

